import UserManagement from "./ManageUsers";
import LoggingIn from "./Login";

export default function ProtectedRoute(props){

    if(props.loginToken){
        return(
            <UserManagement/>
        );
    }
    else{
        return(
          <LoggingIn/>
        );
    }


}
